const polarities = {};
function findNextPolarity(inputs) {
  let i = 0;
  let nextLetter = inputs[i].toLowerCase();
  while (polarities[nextLetter]) {
    i = i + 1;
    console.log(nextLetter, i);
    if (i < inputs.length) {
      nextLetter = inputs[i].toLowerCase();
    } else {
      break;
    }
  }
  if (i < inputs.length) {
    // return inputs[i].toLowerCase();\
    return nextLetter;
  }
  return null;
}

function getLengthRemovingUnit(unit, inputs) {
  const filtered = inputs.filter(i => i.toLowerCase() !== unit);
  let prevLength = filtered.length;
  let newInput = removePolarities(filtered);
  let newLength = newInput.length;
  while (newLength !== prevLength) {
    prevLength = newLength;
    newInput = removePolarities(newInput);
    newLength = newInput.length;
  }
  //   console.log(unit, newLength);
  polarities[unit] = newLength;
}

let nextLetter = findNextPolarity(input);
while (nextLetter) {
  //   console.log(nextLetter);
  getLengthRemovingUnit(nextLetter, input);
  console.log("removed - ", nextLetter);
  nextLetter = findNextPolarity(input);
  console.log("next - ", nextLetter);
}

